function Movie(movie) {
    return (
        <div key={movie.id}>
            <img src={movie.medium_cover_image}/>
            <h2>{movie.title}</h2>
            <p>{movie.summary}</p>
            <ul>
            {movie.genres.map((g, gi) => <li key={`${movie.id}_${gi}`}>{g}</li>)}
            </ul>
        </div>
    );
}

export default Movie;
